import './game.css'
import { useHistory } from 'react-router'

function Game() {
  const history = useHistory()

  const handleNormalClick = () => {
    history.push('/game/normal')
  }

  const handleHardClick = () => {
    history.push('/game/hard')
  }
  return (
    <div className="App">
      <header className="App-header">
        <div>
          <h1 className="Difficulty">Game Mode Select</h1>
          <div className="Difficult-mode">
            <button onClick={handleNormalClick}>Normal</button>
            <button onClick={handleHardClick}>Hard</button>
          </div>
        </div>
      </header>
    </div>
  )
}

export default Game
